import ExpenseItem from "./ExpenseItem";

function Expenses(prop) {
  return (
    <div>
      <ExpenseItem
        title={prop.title[0]}
        amount={prop.amount[0]}
        date={prop.date[0]}
      ></ExpenseItem>
      <ExpenseItem
        title={prop.title[1]}
        amount={prop.amount[1]}
        date={prop.date[1]}
      ></ExpenseItem>
      <ExpenseItem
        title={prop.title[2]}
        amount={prop.amount[2]}
        date={prop.date[2]}
      ></ExpenseItem>
      <ExpenseItem
        title={prop.title[3]}
        amount={prop.amount[3]}
        date={prop.date[3]}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
